import React from 'react';
import './ViewCard.css';

const ViewCard = () => {
    return (
        <div className='ViewCardContainer'>
            <div className='ViewCardInteract'></div>
            <div className='ViewCardInfo'></div>
            <div className='ViewCardChaperList'></div>
        </div>

    );
};

export default ViewCard
